import React from 'react';
import style from './Header.module.css';
import LogoSpectre from './Logo/logo';
import Radium from 'radium';

const header = () => {
    return (        
      <div className={style.Header}>
        <LogoSpectre/>
      </div>
    );
}

export default Radium(header);
